<script setup lang="ts">
import gsap from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger';
import { ScrollSmoother } from 'gsap/ScrollSmoother';

import Menu from '~/components/Menu.vue';

const openCarousel = ref<boolean>(false)

let tl: gsap.core.Timeline | null = null

gsap.registerPlugin(ScrollTrigger, ScrollSmoother)

onMounted(async () => {
  await nextTick()

  gsap.fromTo('#project', 
    { filter: 'blur(0px) brightness(0)', },
    { 
        filter: 'blur(0px) brightness(1)',
        ease: 'power1.in'
    }
  ),

  ScrollSmoother.create({
    smooth: 4,
    effects: true
  })

  tl = gsap.timeline({
    scrollTrigger: {
      trigger: '#project',
      pin: true,
      scrub: 2,
      start: 'top top',
      end: '100%'
    }
  })
  
  tl.to('#door', {
    x: 65,
    ease: 'power1'
  })

  .fromTo('#box', 
    { filter: 'blur(1px) brightness(0.2)' },
    {
      scale: 1.6,
      y: 100,
      filter: 'blur(0px) brightness(0.4)',
      transformOrigin: 'center center',
      ease:'linear',
      onComplete: () => {
        openCarousel.value = true

        gsap.killTweensOf('#box')
      }
    }
  )

  requestAnimationFrame(() => {
    ScrollTrigger.refresh()
  })
})
</script>

<template>
  <div
    id="project" 
    class="w-screen max-w-screen h-screen relative overflow-hidden"
  >

    <Menu />

    <Guides detail="Find a box to unlock a project card (Just scroll down)."/>

    <div v-if="openCarousel" id="carousel">
      <ProjectCarousel />
    </div>

    <Phone />
    
    <!-- Background -->
    <div class="w-full h-full fixed inset-0 -z-10 overflow-hidden">
      <svg class="w-full h-full" preserveAspectRatio="xMidYMid slice" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 1104 643" fill="none">

        <rect width="1104" height="643" fill="url(#pattern0_3_2)"/>

        <!-- Box -->
        <image id="box" href="/box.png" x="500" y="390" width="60" height="60" />

        <g clip-path="url(#clip-house)">
          <rect id="door" x="495" y="259" width="73" height="217" fill="url(#pattern1_3_2)" class="z-10" />
        </g>

        <defs>
          <clipPath id="clip-house">
              <rect x="470" y="250" width="97" height="230" />
          </clipPath>

          <pattern id="pattern0_3_2" patternContentUnits="objectBoundingBox" width="1" height="1">
            <use xlink:href="#image0_3_2" transform="scale(0.000905797 0.00155521)"/>
          </pattern>

          <pattern id="pattern1_3_2" patternContentUnits="objectBoundingBox" width="1" height="1">
           <use xlink:href="#image1_3_2" transform="matrix(0.00917431 0 0 0.00308629 0 -0.00152201)"/>
          </pattern>

          <image id="image0_3_2" width="1104" height="643" preserveAspectRatio="none" xlink:href="data:image/jpeg;base64,"/>
          <image id="image1_3_2" width="109" height="325" preserveAspectRatio="none" xlink:href="data:image/jpeg;base64,"/>
        </defs>
      </svg>
    </div>
    
  </div>
</template>
            